import { Slide } from 'react-slideshow-image';

const slideImages = [
  "https://images.unsplash.com/photo-1633113089635-115b38c66c49?ixlib=rb-1.2.1&ixid=MnwxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1470&q=80",
];

const SlideShow = () => {
    return (
      <div>
        <Slide easing="ease">
          <div className="each-slide">
            <img src= {slideImages[0]} height="20vw"/>

          </div>
          <div className="each-slide">
          <img src= {slideImages[1]} height="20vw"/>
          </div>
          <div className="each-slide">
          <img src= {slideImages[2]} height="20vw"/>
          </div>
        </Slide>
      </div>
    )
};

export default SlideShow;
